ml-testing-toolkit-backend:
  config_files:
    system_config.json:
      {
        "INIT_CONFIG": {
          "objectStore": {
            "partyInfo" : {
              "provisionedParties": [
                # Configure the wallet login credential and data here.
                # {
                #   "displayName": "Shibu S Narayanan",
                #   "firstName": "Shibu",
                #   "middleName": "S",
                #   "lastName": "Naryanan",
                #   "dateOfBirth": "1974-05-14",
                #   "idType": "ACCOUNT_ID",
                #   "idValue": "7967395049"
                # }
              ]
            }
          }
        }
      }
    user_config.json:
      {
        "CALLBACK_RESOURCE_ENDPOINTS": {
          "enabled": true,
          "endpoints": [
            {
              "method": "put",
              "path": "/parties/{Type}/{ID}",
              "endpoint": "http://ml-account-lookup-service"
            },
            {
              "method": "put",
              "path": "/quotes/{ID}",
              "endpoint": "http://ml-quoting-service"
            },
            {
              "method": "put",
              "path": "/transfers/{ID}",
              "endpoint": "http://ml-ml-api-adapter-service"
            }
          ]
        },
      }
    rules_response__default.json:
      [
        {
          "ruleId": 6,
          "priority": 1,
          "description": "post /quotes",
          "apiVersion": {
            "minorVersion": 0,
            "majorVersion": 1,
            "type": "fspiop",
            "asynchronous": true,
            "specFile": "spec_files/api_definitions/fspiop_1.0/api_spec.yaml",
            "callbackMapFile": "spec_files/api_definitions/fspiop_1.0/callback_map.json",
            "responseMapFile": "spec_files/api_definitions/fspiop_1.0/response_map.json",
            "jsfRefFile": "spec_files/api_definitions/fspiop_1.0/mockRef.json",
            "triggerTemplatesFolder": "spec_files/api_definitions/fspiop_1.0/trigger_templates"
          },
          "conditions": {
            "all": [
              {
                "fact": "operationPath",
                "operator": "equal",
                "value": "/quotes"
              },
              {
                "fact": "method",
                "operator": "equal",
                "value": "post"
              }
            ]
          },
          "event": {
            "method": null,
            "path": null,
            "params": {
              "scripts": {
                "exec": [
                  "const requestBody = JSON.parse(request.body)",
                  "",
                  "const toPartyId = requestBody.payee.partyIdInfo.partyIdType + '/' + requestBody.payee.partyIdInfo.partyIdentifier",
                  "",
                  "if (!environment.partyData) {",
                  "  environment.partyData = {}",
                  "}",
                  "",
                  "if (!environment.partyData[toPartyId]) {",
                  "  environment.partyData[toPartyId] = {}",
                  "}",
                  "",
                  "const partyData = environment.partyData[toPartyId]",
                  "",
                  "if (!partyData.balance) {",
                  "  partyData.balance = {}",
                  "}",
                  "",
                  "if (!partyData.balance[requestBody.amount.currency]) {",
                  "  partyData.balance[requestBody.amount.currency] = 0",
                  "}",
                  "",
                  "partyData.balance[requestBody.amount.currency] += +requestBody.amount.amount",
                  "",
                  "",
                  "if (!partyData.transactionHistory) {",
                  "  partyData.transactionHistory = []",
                  "}",
                  "const creditDate = new Date(request.headers.date)",
                  "const transaction = {",
                  "  date: creditDate.getTime(),",
                  "  transferId: requestBody.transactionId,",
                  "  amount: requestBody.amount.amount,",
                  "  currency: requestBody.amount.currency,",
                  "  from: {",
                  "    idType: requestBody.payer.partyIdInfo.partyIdType,",
                  "    idValue: requestBody.payer.partyIdInfo.partyIdentifier",
                  "  }",
                  "}",
                  "partyData.transactionHistory.push(transaction)",
                  "",
                  "custom.pushMessage({ transaction: transaction, newBalance: partyData.balance , transactionHistory: partyData.transactionHistory }, toPartyId)"
                ],
                "scriptingEngine": "javascript"
              }
            },
            "type": "MOCK_RESPONSE"
          },
          "type": "response",
          "version": 1
        }
      ]
ml-testing-toolkit-frontend:
  config:
    API_BASE_URL: https://${ML_TTK_HOSTNAME}
    PAYEE_SIM_BRAND_ICON: data:image/png;base64,
